import React from 'react'

import { styled } from 'styled-components'

const StyledButton = styled.button`
    height:40px;
    width:auto;
    border:none;
    color:white;
    padding:5px;
    border-radius:10px;
    background-color:#597CFF;
`

const Button = ({text}) => {
  return (
    <StyledButton>
        {text}
    </StyledButton>
  )
}

export default Button
